import React from 'react';
import { useState,useEffect} from 'react';

const Home = () => {
  const [news,setNews]=useState("Heyy");
  let api="https://api.rss2json.com/v1/api.json?rss_url=https%3A%2F%2Ftimesofindia.indiatimes.com%2Frssfeedstopstories.cms";
  const fetchApiData=async(url)=>{
   try {
       const res=await fetch(url);
       const data=await res.json();
       setNews(data.items[0]);
       console.log(news);
   } catch (error) {
       console.log(error);
   }
  }
   useEffect(()=>{
       fetchApiData(api);
   },[]);

  //  news.map((element)=>{
  //   return <div className='home'>
  //     <h1>{element.title}</h1>
  //   </div>
  //  })
  return (
    
     <>
     {news.map((element)=>{
      <div className='home'>
      <h1>{element.title}</h1>
      </div>
     })}
      
     </>
   
  )
}

export default Home;
